### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Asymptotic Notation and Complexity Analysis**
- **Big O Notation (O)**: Describes the upper bound of an algorithm's running time.
  - \( f(n) = O(g(n)) \) if there exist constants \( c \) and \( n_0 \) such that \( f(n) \leq c \cdot g(n) \) for all \( n \geq n_0 \).
- **Omega Notation (Ω)**: Describes the lower bound of an algorithm's running time.
  - \( f(n) = \Omega(g(n)) \) if there exist constants \( c \) and \( n_0 \) such that \( f(n) \geq c \cdot g(n) \) for all \( n \geq n_0 \).
- **Theta Notation (Θ)**: Describes the exact bound of an algorithm's running time.
  - \( f(n) = \Theta(g(n)) \) if \( f(n) = O(g(n)) \) and \( f(n) = \Omega(g(n)) \).

#### 2. **Data Structures**
- **Linked Lists**: Linear data structure where each element is a separate object.
  - **Operations**: Insertion, deletion, searching.
  - **Time Complexity**: Insertion at the end \( O(n) \), deletion at the end \( O(n) \), searching \( O(n) \).
- **Hash Tables**: Data structure that implements an associative array.
  - **Collision Resolution**: Linear probing, quadratic probing, chaining.
  - **Hash Function**: \( h(key) = key \mod m \).
- **Stacks and Queues**: Linear data structures.
  - **Stack Operations**: Push, pop, isEmpty.
  - **Queue Operations**: Enqueue, dequeue, isEmpty.

#### 3. **Sorting Algorithms**
- **Insertion Sort**: Builds the final sorted array one item at a time.
  - **Time Complexity**: \( O(n^2) \).
- **Merge Sort**: Divide and conquer algorithm.
  - **Time Complexity**: \( O(n \log n) \).
- **Quick Sort**: Divide and conquer algorithm.
  - **Time Complexity**: Average case \( O(n \log n) \), worst case \( O(n^2) \).
- **Stable Sort**: Preserves the relative order of equal elements.

#### 4. **Graph Algorithms**
- **Breadth-First Search (BFS)**: Explores the neighbor nodes first.
  - **Time Complexity**: \( O(V + E) \).
- **Depth-First Search (DFS)**: Explores as far as possible along each branch before backtracking.
  - **Time Complexity**: \( O(V + E) \).
- **Topological Sorting**: Linear ordering of vertices such that for every directed edge \( uv \), vertex \( u \) comes before \( v \) in the ordering.
- **Unimodal List**: A list that first increases and then decreases.
  - **Finding Maximum**: Use binary search to find the maximum in \( O(\log n) \) time.

#### 5. **Mathematical Concepts**
- **Logarithms**: \( \log n \) is the inverse of the exponential function.
- **Graph Theory**: Minimum number of vertices in a graph with \( m \) edges.
  - For a simple, undirected graph, the minimum number of vertices \( n \) is given by \( n(n-1)/2 \geq m \).

